import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className='row first text-center position-relative py-3'>
        {/* <div className='col position-absolute  end-0'>Signup</div> */}
        <button className='col-1 btn bg-white mx-'>Signup</button>
        <button className='col-1 btn bg-white'>Login</button>
      </div>
    </div>
  );
}

export default App;
